import React from 'react';
import { View, Text, StyleSheet, TextInput, TouchableOpacity } from 'react-native';
import { useNavigation } from '@react-navigation/native';
import Icon from 'react-native-vector-icons/MaterialIcons';

import Container from '../components/background';

const UserRegisterationScreen = () => {

    const navigation = useNavigation();

  return (
    <Container>
        <View style={styles.header}>
                <TouchableOpacity onPress={() => navigation.navigate("SignUp")}>
                    <Icon 
                        name='arrow-back-ios'
                        size={20}
                        color= '#dedfe0'
                    />
                </TouchableOpacity>
                <Text
                    style={{
                        color: '#dedfe0',
                        fontSize: 20, 
                        paddingLeft: '25%'                       
                    }}
                >
                    Registeration
                </Text>
        </View>
        <View style={styles.heading}>
            <Text 
                style={{
                    color: '#dedfe0', 
                    fontSize: 20,  
                    paddingBottom: 10,
                }}
            >
                Account Information
            </Text>
        </View>
        
        <View style={styles.content}>
            {/* <Text>Full Name</Text> */}
            <TextInput
                style={styles.input}
                placeholder= 'username'
                placeholderTextColor={'#d9dadb'}
            />
            <TextInput
                style={styles.input}
                placeholder= 'password'
                placeholderTextColor={'#d9dadb'}
            />
            <TextInput
                style={styles.input}
                placeholder= 'confirm password'
                placeholderTextColor={'#d9dadb'}
            />
        </View>
        <View style = {styles.buttonBox}>
            <TouchableOpacity style={styles.button} onPress={() => navigation.navigate("Account-Info")}>
                <Text style={{color: '#dedfe0', fontSize:18,}} >Register</Text>
            </TouchableOpacity>
        </View>
    </Container>
  );
};

const styles = StyleSheet.create({
    header: {
        flexDirection: 'row',
        backgroundColor: '#23476b',
        padding: 20,
        alignItems: 'center'
    },
    heading: {
        flex: 0.1,
        marginTop: '10%',
        paddingLeft: '10%',
        paddingRight: '10%',
        justifyContent: 'center'
    },
    content: {
        flex: 0.7,
        alignItems: 'center',
    },
    text: {
        color: 'white',
    },
    input: {
        backgroundColor: '#54A1C3',
        width: '85%',
        color: '#b4edff',
        padding: 18,
        borderRadius: 15,
        marginTop: 30,
        fontSize: 16,
    },
    buttonBox:{
        alignItems: 'center'
    },
    button: {
        justifyContent: 'center',
        alignItems: 'center',
        height: '25%',
        width: '30%',
        backgroundColor: '#05445E',
        padding: 10,
        borderRadius: 15,
    },
});

export default UserRegisterationScreen;
